  false,\n\t\"url\": null,\n\t\"notes\": \"Every January, Finance mails New York City
  property owners a Notice of Property Value (NOPV). This important notice has information
  about your propertyu2019s market and assessed values. Finance determines your propertyu2019s
  value every year, according to State law. The Cityu02bcs property tax rates are
  applied to the assessed value to calculate your property taxes for the next tax
  year. You get your first tax bill for the year in June. If you believe the values
  or property descriptions on the NOPV are not correct.\",\n\t\"license_title\": \"License
